// frontend/src/App.js
import React, { useState, useEffect, useRef } from "react";

function Message({ msg }) {
  if (msg.type === "card") {
    const card = msg.card;
    return (
      <div className="w-full flex justify-start my-2">
        <div className="inline-block bg-white shadow p-3 rounded max-w-xl">
          {card.image_url && (
            <img
              src={card.image_url}
              alt={card.name}
              className="w-full h-32 object-cover rounded mb-2"
            />
          )}
          <h3 className="font-bold text-lg">{card.name}</h3>
          {card.reward_simulation && (
            <p className="mt-1 italic">{card.reward_simulation}</p>
          )}
          <p className="mt-2">{card.reason}</p>
        </div>
      </div>
    );
  }
  // text message
  const align = msg.from === "bot" ? "justify-start" : "justify-end";
  const bg = msg.from === "bot" ? "bg-white shadow" : "bg-blue-500 text-white";
  return (
    <div className={`w-full flex ${align} my-2`}>
      <span className={`inline-block p-3 rounded whitespace-pre-wrap max-w-xs ${bg}`}>
        {msg.text}
      </span>
    </div>
  );
}

export default function App() {
  const [sessionId] = useState(() => Date.now().toString());
  const [msgs, setMsgs] = useState([
    {
      type: "text",
      from: "bot",
      text: "Hello! I’m your Credit Card Advisor. Let’s start with your profile.",
    },
  ]);
  const [input, setInput] = useState("");
  const bottomRef = useRef();

  useEffect(() => {
    bottomRef.current?.scrollIntoView({ behavior: "smooth" });
  }, [msgs]);

  // detect if last bot question needs numeric input
  const lastBot = [...msgs]
    .reverse()
    .find((m) => m.from === "bot" && m.type === "text");
  const numericOnly = lastBot
    ? /%|income/i.test(lastBot.text)
    : false;

  const sendMessage = async (e) => {
    e.preventDefault();
    if (!input.trim()) return;

    setMsgs((m) => [...m, { type: "text", from: "user", text: input }]);
    const userText = input;
    setInput("");

    const res = await fetch("http://localhost:8000/chat", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ session_id: sessionId, message: userText }),
    });

    if (!res.ok) {
      setMsgs((m) => [
        ...m,
        { type: "text", from: "bot", text: "Oops, something went wrong." },
      ]);
      return;
    }

    const data = await res.json();

    if (data.recommendations) {
      // inject each card as a chat message
      setMsgs((m) => [
        ...m,
        ...data.recommendations.map((c) => ({ type: "card", card: c })),
      ]);
      return;
    }

    if (data.reply) {
      setMsgs((m) => [
        ...m,
        { type: "text", from: "bot", text: data.reply },
      ]);
    } else {
      // validation failure: re-ask the same question
      const lastQ = lastBot?.text || "Sorry, I didn’t understand that.";
      setMsgs((m) => [
        ...m,
        { type: "text", from: "bot", text: lastQ },
      ]);
    }
  };

  return (
    <div className="h-screen flex flex-col bg-gray-50">
      {/* Chat history */}
      <div className="flex-1 overflow-y-auto p-4 flex flex-col items-start max-w-xl mx-auto">
        {msgs.map((m, i) => (
          <Message key={i} msg={m} />
        ))}
        <div ref={bottomRef} />
      </div>

      {/* Always‐visible input, numeric if needed */}
      <form onSubmit={sendMessage} className="p-4 max-w-xl mx-auto flex gap-2">
        <input
          type={numericOnly ? "number" : "text"}
          inputMode={numericOnly ? "numeric" : "text"}
          pattern={numericOnly ? "[0-9]*" : undefined}
          className="flex-grow p-2 border rounded"
          placeholder="Type your answer…"
          value={input}
          onChange={(e) => setInput(e.target.value)}
        />
        <button className="bg-blue-600 text-white px-4 py-2 rounded">
          Send
        </button>
      </form>
    </div>
  );
}
